$MerriamWebsterDictionary = (ConvertFrom-Base64 $DictionaryHash) -split "`r`n"

$MerriamWebsterDictionary | Select-String "^[$UsableCharacters]+$" -AllMatches | ? {$_ -match "$RequiredCharacter"} | % {
    $Word = $_.ToString()
    $Score = 0
    $WordLength = $Word.Length

    # Calculate Base Score based on Length of Word
    Switch ($WordLength) {
        {$_ -lt 4} { $Score = 0 }
        4 { $Score = 2 }
        5 { $Score = 4 }
        6 { $Score = 6 }
        7 { $Score = 12 }
        {$_ -gt 7} {
            $GreaterThan7By = $WordLength - 7
            $Score = 12 + ($GreaterThan7By * 3) 
        }
    }

    if ($BonusCharacter) {
        # Add Points for use of the bonus character
        $Score += ($Word | sls "$BonusCharacter" -AllMatches).Matches.Length * 5
    }

    # Add Points if word is a pangram
    $IsPangram = ($Word.ToLower().ToCharArray() | Select -Unique).Length -eq $UsableCharacters.Length
    if ($IsPangram) { $Score += 7 }

    if (!($OnlyPangrams -and $IsPangram -eq $false)) {
        [PSCustomObject]@{
            Word = $Word
            Score = $Score
            IsPangram = $IsPangram
        }
    }

} | Sort-Object -Property Score